import Paper from '@mui/material/Paper';
import { Box } from '@mui/material';

const ProductCard = () => {
  return (
            <Paper elevation={3} sx={{
            display: 'flex',
            flexWrap: 'wrap',
            width: 300,
            height: 300,
            backgroundColor: 'red'
      }}>Same Size</Paper>
  )
}

export default ProductCard;
